pragma solidity ^0.8.17;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/token/ERC20/extensions/ERC20Burnable.sol";



contract ERC20v2 is ERC20 ,ERC20Burnable{
    mapping(address => uint256) private _balances;

    mapping(address => mapping(address => uint256)) private _allowances;

    uint256 immutable private i_decimals;
    uint256 private _totalSupply;
    string private _name;
    string private _symbol;
    address private immutable i_owner;
    uint256 private s_burnPercent;
    uint256 private  _maxSupply;

    constructor(string memory name, string memory symbol, uint256 maxSupply, uint256 firstSupply, uint256 burnPercent, uint256 decimals ,address owner) ERC20(name,symbol)  {
        _name = name;
        _symbol = symbol;
        _mint(msg.sender, firstSupply);
        i_decimals = decimals;
        i_owner = owner;
        s_burnPercent = burnPercent;
        _maxSupply = maxSupply;
    }

    modifier onlyOwner {
        require(msg.sender == i_owner);
        _;
    }

    modifier supplyLimit (uint256 amount){
        if (_maxSupply > 0 ) {
            require (_maxSupply >= _totalSupply + amount,"Max Supply");
        }
        _;

    }

    function mint(address userAddress, uint256 amount) external onlyOwner{
        _mint(userAddress, amount);
    }


   function _transfer(
        address from,
        address to,
        uint256 amount
    ) internal virtual override {
        require(from != address(0), "ERC20: transfer from the zero address");
        require(to != address(0), "ERC20: transfer to the zero address");

        uint256 fromBalance = _balances[from];
        require(fromBalance >= amount, "ERC20: transfer amount exceeds balance");

        uint256 finalAmount = amount;
        if (s_burnPercent > 0) {
            uint256 burnedAmount = (s_burnPercent * amount);
            finalAmount -= burnedAmount;
            unchecked {
                _balances[address(0)] -= burnedAmount;
                _totalSupply -= burnedAmount;
            }
        }

        unchecked {
            _balances[from] = fromBalance - amount;
            // Overflow not possible: the sum of all balances is capped by totalSupply, and the sum is preserved by
            // decrementing then incrementing.
            _balances[to] += finalAmount;
        }

        emit Transfer(from, to, amount);

        _afterTokenTransfer(from, to, amount);
    }

    function _mint(address account, uint256 amount) internal virtual override supplyLimit(amount) {
        require(account != address(0), "ERC20: mint to the zero address");

        super._beforeTokenTransfer(address(0), account, amount);

        _totalSupply += amount;
        unchecked {
            // Overflow not possible: balance + amount is at most totalSupply + amount, which is checked above.
            _balances[account] += amount;
        }
        emit Transfer(address(0), account, amount);

        _afterTokenTransfer(address(0), account, amount);
    }

    function _beforeTokenTransfer(address from,address to,uint256 amount) internal virtual override{
        if (s_burnPercent > 0) {
            uint256 fromBalance = _balances[from];
            uint256 burnedAmount = (s_burnPercent * amount);
            unchecked {
                _balances[from] = fromBalance - burnedAmount;
                _balances[address(0)] -= burnedAmount;
                _totalSupply -= burnedAmount;
            }
        }
    }

    function setBurnPercent(uint256 amount) external onlyOwner{
        s_burnPercent = amount;
    }

    function burnByOwner( uint256 amount) external onlyOwner{
        _burn(msg.sender, amount);
    }

    function destroy () external onlyOwner {
        selfdestruct(payable(i_owner));
    }


}","keccak256":"0x58ae05270967e63ca3c76aa1e416afe6994462d874c4249d2bf0c16247793c10","license":"MIT"},"contracts/ERC721Upgreadable.sol":{"content":"// SPDX-License-Identifier: MIT

pragma solidity ^0.8.17;

import "@openzeppelin/contracts-upgradeable/token/ERC721/ERC721Upgradeable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";



contract ERC721V1Upgreadable is ERC721Upgradeable {

    event Withdraw(address user, address contractAddress, uint256 value);

    string private _name;
    string private _symbol;
    uint256 private _price;
    string private _url;
    address private _owner;
    uint256 private counterID;


    // Mapping from token ID to owner address
    mapping(uint256 => address) private _owners;

    // Mapping owner address to token count
    mapping(address => uint256) private _balances;

    modifier onlyOwner {
        require(msg.sender == _owner, "Not owner");
        _;
    }

    function __ERC721_init(string memory name_, string memory symbol_,address owner,string memory imageURL) internal onlyInitializing {
        require(msg.value >= _price, "Insufficient fee");
        _owner = owner;
        _url = imageURL;
        __ERC721_init_unchained(name_, symbol_);
    }



    function __ERC721_init_unchained(string memory name_, string memory symbol_) internal override onlyInitializing {
        _name = name_;
        _symbol = symbol_;
    }

    function _safeMint(address to) internal virtual {
        _safeMint(to, counterID, "");
        counterID ++;
    }



    function _mint(address to, uint256 tokenId) internal virtual override {
        require(to != address(0), "ERC721: mint to the zero address");
        require(!_exists(tokenId), "ERC721: token already minted");         
        require(msg.value > _price, "ERC721: mint needs mintFee");
        _beforeTokenTransfer(address(0), to, tokenId, 1);

        // Check that tokenId was not minted by `_beforeTokenTransfer` hook
        require(!_exists(tokenId), "ERC721: token already minted");

        unchecked {
            // Will not overflow unless all 2**256 token ids are minted to the same owner.
            // Given that tokens are minted one by one, it is impossible in practice that
            // this ever happens. Might change if we allow batch minting.
            // The ERC fails to describe this case.
            _balances[to] += 1;
        }

        _owners[tokenId] = to;

        emit Transfer(address(0), to, tokenId);

        _afterTokenTransfer(address(0), to, tokenId, 1);
    }

    function withdraw () external payable {
        (bool ok, ) = msg.sender.call{value: address(this).balance}("");
        if (ok) {
            emit Withdraw(msg.sender, address(this), address(this).balance);
        }
    }

    function _baseURI() internal view virtual override returns (string memory) {
        return _url;
    }
    // should add only owner modifier
    function setUri(string memory newUri) external onlyOwner {
        _url = newUri;
    }

    function transferOwnership(address newOwner) external onlyOwner {
        _owner = newOwner;
    }



}

